Get distinct days from a collection of dates in MongoDB<p>I want to populate a date range picker display with highlighted cells where data exists in my database. I thus need to reduce my collection to an array of dates where records exist e.g.</p>

<pre><code>// collection
[{
  timestamp: ISODate("2020-01-28T20:42:00.000Z"),
  data: 1,
},{
  timestamp: ISODate("2020-01-28T18:42:00.000Z"),
  data: 10,
},{
  timestamp: ISODate("2020-01-28T15:42:00.000Z"),
  data: 100,
},{
  timestamp: ISODate("2020-01-25T15:42:00.000Z"),
  data: 1000,
},{
  timestamp: ISODate("2020-01-17T15:42:00.000Z"),
  data: 10000,
}]
</code></pre>

<p>reduces to:</p>

<pre><code>['2020-01-28', '2020-01-25', '2020-01-17']
</code></pre>

<p>The nature of the data stored in my database means that if any data exists on a given date, lots of data exists on that date. It is therefore slow to query the entire collection for a given date range and then reduce the result. </p>

<p>Is there a fast(er) way to query a collection to return the distinct set of dates on which data exists?</p>

